using Decimals
using Test
using Decimals: @with_context

@testset "Max" begin
@with_context (Emax = 384, Emin = -383, precision = 9, rounding = RoundingMode{:NearestTiesAway}()) @test(max(dec"-2", dec"-2") == dec"-2")
@with_context (Emax = 384, Emin = -383, precision = 9, rounding = RoundingMode{:NearestTiesAway}()) @test(max(dec"-2", dec"-1") == dec"-1")
